import React from "react";
import { Inputes } from "./components/Inputes";
import { Canvas } from "./components/Canvas";
import { useSelector } from "react-redux";

import "./App.css";

export const App = () => {
  const { isFetching } = useSelector(state => state);
  return (

      <div className="main-body">
        <Inputes />
        <Canvas />
      </div>

  );
};
